const Launches = () => {

    const shoes = [{
        name: 'Crossover Brogues',
        img: 'crossover-burgues.png',
        price: 'Rs 2,699'
    },
    {
        name: 'Luxe Brogues',
        img: 'luxe-burgues.png',
        price: 'Rs 2,999'
    },
    {
        name: 'The Derbies',
        img: 'derbies.png',
        price: 'Rs 2,999'
    },
    {
        name: 'Light Trainers',
        img: 'trainers.png',
        price: 'Rs 1,999'
    }
    ]
    return (
        <div className="shoes">
            <p className="shoeHeading">New Launches</p>

            <div className="cards">
                <div className="crossover"></div>
                <div className="luxe"></div>
                <div className="derbies"></div>
                <div className="trainers"></div>
            </div>
        </div>
    );
}

export default Launches;
